Rust语言类型与关键词 对于修饰词关键词'static'，Rust语言以与常量类似的方式提供了类似“全局变量”的功能。对每一个值只有一个实例，并且位于内存中的固定位置。 在Rust语言里，存在一类关键词是修饰词关键词，如关键词"pub"和“static”。 类型 关键词 类型说明 &str 字符串文字 'static 静态修饰词关键词 ' 生命周期注释符 'static 静态生命周期注释符 浅谈软件篋的模块 每一个共享篋都有自己的入口模块名称，这里是hello_exercism，使用共享篋都要从这个名称开始，这里模块hello_exercism有自己的函数hello()。程序文件lib.rs可以使用关键词mod再定义模块名称，但是它们都是hello_exercism的子模块。 函数hello()功能 从作用意义上，共享篋的函数hello()类似于使用关键词let语句，即可把它看作为一个类型为&str的字符串与一个变量绑定，如下所示： // Rust File: examples/main.rs
fn main() { let _: &'static str = "Hello, World!"; let _: &str = "Hello, World!";
} 表达式、语句和模块 在Rust语言里，表达式和语句都可以作为一行代码。要是一行代码，最后没有分号就是表达式，而有分号就是语句。表达式只有作为函数的返回值。 表达式和语句可以汇聚成一个由{}内的代码块和由关键词fn开始的函数与方法。函数和方法可以组成一个由关键词mod开始的模块。若干个模块可以形成由关键词mod开始的父模块。 项目配置文件 除了项目配置文件Cargo.toml之外，还可以有其它功能的配置文件，如工具rustfmt的配置文件。

